Ext.data.JsonP['ScriptDoc_(SDOC)_2.0_Specification']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>ScriptDoc (SDOC) 2.0 Specification</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-30083174\" class=\"content\">\n                        <h1>ScriptDoc (SDOC) 2.0 Specification</h1>\n    <div class=\"section section-2 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1Db250ZW50cw\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1PdmVydmlldw\">Overview</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1SZWZlcmVuY2U\">Reference</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AYWxpYXM\">@alias</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AYXV0aG9y\">@author</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AY2xhc3NEZXNjcmlwdGlvbg\">@classDescription</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AY29uc3RydWN0b3I\">@constructor</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AZGVwcmVjYXRlZA\">@deprecated</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AZXhhbXBsZQ\">@example</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AZXhjZXB0aW9u\">@exception</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AaWQ\">@id</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AaW5oZXJpdHM\">@inherits</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AaW50ZXJuYWw\">@internal</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AbWVtYmVyT2Y\">@memberOf</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AbWV0aG9k\">@method</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AbmFtZXNwYWNl\">@namespace</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcGFyYW0\">@param</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcHJpdmF0ZQ\">@private</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcHJvamVjdERlc2NyaXB0aW9u\">@projectDescription</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcHJvcGVydHk\">@property</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcmV0dXJu\">@return</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1Ac2Vl\">@see</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1Ac2luY2U\">@since</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AdHlwZQ\">@type</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AdmVyc2lvbg\">@version</a>    </p>\n</li></ul></li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1PdmVydmlldw\">\n        <h2 class=\"heading \"><span>Overview</span></h2>\n    <p>This reference page provides comprehensive documentation for all ScriptDoc tags, in alphabetical order.    </p>\n    <p>Several tags have &quot;synonyms&quot; where you can use two differently named tags to document the same thing. You can use a synonym by using the exact same syntax as the original tag, but just substituting the tag name.    </p>\n    <p>The section for each tag includes the following information:    </p>\n<ul class=\" \"><li class=\" \">    <p>Short description of the tag    </p>\n</li><li class=\" \">    <p>Syntax    </p>\n</li><li class=\" \">    <p>What the tag applies to    </p>\n</li><li class=\" \">    <p>Longer explanation of the tag    </p>\n</li><li class=\" \">    <p>Example (Some tags have multiple examples)    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1SZWZlcmVuY2U\">\n        <h2 class=\"heading \"><span>Reference</span></h2>\n    <p>The following tags are valid for code documentation:    </p>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1hbGlhcw\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1hbGlhcw\"/></span>\n    </p>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AYWxpYXM\">\n        <h3 class=\"heading \"><span>@alias</span></h3>\n    <p>ID for a class or function.    </p>\n    <p>Applies to: Any    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@alias fooBar    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @alias tag to ID a class or function if you have used a &quot;shorthand&quot; way to code the full name for that class or function.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows the @alias tag used to id a function called fooBar in the FOO.Lib namespace.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"plain\">FOO.Lib.update(FOO.Lib) {</code></div>\n<div class=\"line\"><code class=\"plain\">    </code></div>\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * Returns a function that will return a number one greater than the previous returned value, starting at n.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @alias fooBar</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @alias FOO.Lib.fooBar</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @param {Object} n\tNumber to start with. Default is 1.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @return {Function) Returns a function that will return a number one greater than the previous returned value.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n<div class=\"line\"><code class=\"plain\">    fooBar: function (n</code><code class=\"comments\">/* = 1 */</code><code class=\"plain\">) {</code></div>\n<div class=\"line\"><code class=\"plain\">        </code><code class=\"keyword\">if</code><code class=\"plain\"> (arguments.length === </code><code class=\"value\">0</code><code class=\"plain\">) {</code></div>\n<div class=\"line\"><code class=\"plain\">            n = </code><code class=\"value\">1</code><code class=\"plain\">;</code></div>\n<div class=\"line\"><code class=\"plain\">        }</code></div>\n<div class=\"line\"><code class=\"plain\">        </code><code class=\"keyword\">return</code><code class=\"plain\"> function () {</code></div>\n<div class=\"line\"><code class=\"plain\">            </code><code class=\"keyword\">return</code><code class=\"plain\"> n++;</code></div>\n<div class=\"line\"><code class=\"plain\">        };</code></div>\n<div class=\"line\"><code class=\"plain\">    },</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1hdXRob3I\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1hdXRob3I\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AYXV0aG9y\">\n        <h3 class=\"heading \"><span>@author</span></h3>\n    <p>Author of a JavaScript file or function.    </p>\n    <p>Applies to: Any    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@author <i class=\" \">Author-name</i> [ <i class=\" \">email</i> ]    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use @author to credit the author of a JavaScript file or function.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows the @author tag used with the <a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wcm9qZWN0RGVzY3JpcHRpb24\">@projectDescription</a> and <a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi12ZXJzaW9u\">@version</a> tags to provide header information for a JavaScript file.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/** </code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @projectDescription \tJoe Smith&apos;s wonderful JavaScript library.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @author\tJoe Smith jsmith@company.com</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @version\t0.1 </code></div>\n<div class=\"line\"><code class=\"preprocessor\">*/</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1jbGFzc0Rlc2NyaXB0aW9u\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1jbGFzc0Rlc2NyaXB0aW9u\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AY2xhc3NEZXNjcmlwdGlvbg\">\n        <h3 class=\"heading \"><span>@classDescription</span></h3>\n    <p>Description of the class.    </p>\n    <p>Applies to: Function    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@classDescription <i class=\" \">Description</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @classDescription tag to give a short description of the class (if applicable).    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a sample documentation block for a basic Shape class.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* Create a new instance of Shape.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @classDescription\tThis class creates a new Shape.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @return {Shape}\tReturns a new Shape.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @type {Object}</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @constructor\t</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*/</code></div>\n<div class=\"line\"><code class=\"plain\">function Shape() {</code></div>\n<div class=\"line\"><code class=\"plain\">}</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1jb25zdHJ1Y3Rvcg\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1jb25zdHJ1Y3Rvcg\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AY29uc3RydWN0b3I\">\n        <h3 class=\"heading \"><span>@constructor</span></h3>\n    <p>Shows that a function is a constructor for a class.    </p>\n    <p>Applies to: Function    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@constructor    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @constructor tag to signify that a function is a constructor if you are coding in an object-oriented programming style.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a sample documentation block for a basic Shape class.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* Create a new instance of Shape.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @classDescription\tThis class creates a new Shape.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @return {Object}\tReturns a new Shape object.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @constructor\t</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*/</code></div>\n<div class=\"line\"><code class=\"plain\">function Shape() {</code></div>\n<div class=\"line\"><code class=\"plain\">}</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1kZXByZWNhdGVk\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1kZXByZWNhdGVk\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AZGVwcmVjYXRlZA\">\n        <h3 class=\"heading \"><span>@deprecated</span></h3>\n    <p>Signifies that a function or a property has been deprecated.    </p>\n    <p>Applies to: Function or property.    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@deprecated    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @deprecated tag to show that a function or a property has been deprecated and should not be used.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a @deprecated tag added to a documentation block for a function.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* This function gets a foo by name.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @param {Object}\tfooName\tName of the foo to retrieve.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @return {Object}\tReturns a new foo.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @deprecated</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*/</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1leGFtcGxl\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1leGFtcGxl\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AZXhhbXBsZQ\">\n        <h3 class=\"heading \"><span>@example</span></h3>\n    <p>Gives an example for the function being documented.    </p>\n    <p>Applies to: Any (except @projectDescription)    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@example <i class=\" \">Example-code</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @example tag when you want to show an example of how to use the code that you are documenting. Any whitespace you add will be included when the tag is parsed. You can also include basic HTML to make your example more readable.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a documentation block for a &quot;move&quot; function that takes the arguments &quot;layerID&quot; and &quot;direction&quot; and includes an @example tag with code example. Use HTML tags to format your descriptions. Use the    </p>\n    <div class=\"confbox programlisting preformatted panel\">\n                <div class=\"content\">\n        <pre><code>{code}{code}</code></pre>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=30083174\"><span>Edit</span></a>\n    </div>\n    <p>tag set to format the example as code. (This example uses the @remarks tag to give more information about the function.)    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"plain\">/**</code></div>\n<div class=\"line\"><code class=\"plain\">* This function moves a layer in the specified direction.</code></div>\n<div class=\"line\"><code class=\"plain\">* </code><code class=\"color1\">@param</code><code class=\"plain\"> {String}\tlayerID\tThe ID </code><code class=\"keyword\">for</code><code class=\"plain\"> the layer to be moved.</code></div>\n<div class=\"line\"><code class=\"plain\">* </code><code class=\"color1\">@param</code><code class=\"plain\"> {String}\tdirection\tThe direction </code><code class=\"keyword\">for</code><code class=\"plain\"> the layer to be moved.</code></div>\n<div class=\"line\"><code class=\"plain\">* </code><code class=\"color1\">@param</code><code class=\"plain\"> {Number}\tnumber\tNumber of pixels to move the layer.</code></div>\n<div class=\"line\"><code class=\"plain\">* </code><code class=\"color1\">@remarks</code><code class=\"plain\"> The direction argument can be </code><code class=\"string\">&quot;right&quot;</code><code class=\"plain\">, </code><code class=\"string\">&quot;left&quot;</code><code class=\"plain\">, </code><code class=\"string\">&quot;up&quot;</code><code class=\"plain\">, or </code><code class=\"string\">&quot;down&quot;</code><code class=\"plain\">.</code></div>\n<div class=\"line\"><code class=\"plain\">*          You cannot move the layer beyond the boundaries of the browser window.</code></div>\n<div class=\"line\"><code class=\"plain\">* </code><code class=\"color1\">@example</code><code class=\"plain\">  Using the move function</code></div>\n<div class=\"line\"><code class=\"plain\">*           This example uses the move function to move myLayer to the right by </code><code class=\"value\">50</code><code class=\"plain\"> pixels.</code></div>\n<div class=\"line\"><code class=\"plain\">*           move(myLayer, right, </code><code class=\"value\">50</code><code class=\"plain\">)</code></div>\n<div class=\"line\"><code class=\"plain\">* /</code></div>\n<div class=\"line\"><code class=\"plain\">function move(layerID, direction, number)</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1leGNlcHRpb24\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1leGNlcHRpb24\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AZXhjZXB0aW9u\">\n        <h3 class=\"heading \"><span>@exception</span></h3>\n    <p>Specifies the type of exception thrown by a function.    </p>\n    <p>Applies to: Function    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@exception { <i class=\" \">Exception</i> } <i class=\" \">Exception-description</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @exception tag to specify any exceptions thrown by a function. You can specify multiple exceptions in a documentation block.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a function that throws two exceptions--a &quot;MemoryException&quot; and a &quot;GeneralShapeException&quot;.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* This function creates a new Shape object. </code></div>\n<div class=\"line\"><code class=\"preprocessor\">*</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @exception\t{MemoryException}\tThrows a memory exception if out of memory. </code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @exception\t{GeneralShapeException}\tThrows a general shape exception if the object is not a shape.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @return \t{Object}\tReturns a new shape object.</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*/</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1pZA\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1pZA\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AaWQ\">\n        <h3 class=\"heading \"><span>@id</span></h3>\n    <p>Unique identifier for a function or property.    </p>\n    <p>Applies to: All    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@id <i class=\" \">identifierName</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use @id to link a function or property to its documentation in an external @sdoc file. Add the @id tag both inline right above a function and to the documentation block in the .sdoc file to create the link.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows an inline @id tag for the function foo.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/** @id */</code></div>\n<div class=\"line\"><code class=\"plain\">function foo() {</code></div>\n<div class=\"line\"><code class=\"plain\">   alert(</code><code class=\"string\">&quot;Foo!&quot;</code><code class=\"plain\">);</code></div>\n<div class=\"line\"><code class=\"plain\">}</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1pbmhlcml0cw\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1pbmhlcml0cw\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AaW5oZXJpdHM\">\n        <h3 class=\"heading \"><span>@inherits</span></h3>\n    <p>Indicates that one item &quot;inherits&quot; from another    </p>\n    <p>Applies to: Function    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"plain\"> </code><code class=\"color1\">@inherits</code><code class=\"plain\"> _functionNameA_</code></div>\n<div class=\"line\"><code class=\"plain\"> </code><code class=\"color1\">@inherits</code><code class=\"plain\"> _functionNameB_</code></div>\n</div>\n    </div>\n    <p>or    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"plain\"> </code><code class=\"color1\">@inherits</code><code class=\"plain\"> _functionNameA_, _functionNameB_</code></div>\n</div>\n    </div>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use @inherits to indicate that one &quot;class&quot; subclasses another in object-oriented JavaScript.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows that bar inherits from foo.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"plain\">function foo() {</code></div>\n<div class=\"line\"><code class=\"plain\">}</code></div>\n<div class=\"line\">&#xA0;</div>\n<div class=\"line\"><code class=\"preprocessor\">/** @inherits foo */</code></div>\n<div class=\"line\"><code class=\"plain\">function bar() {</code></div>\n<div class=\"line\"><code class=\"plain\">}</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1pbnRlcm5hbA\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1pbnRlcm5hbA\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AaW50ZXJuYWw\">\n        <h3 class=\"heading \"><span>@internal</span></h3>\n    <p>Specifies that a function or property should not be made visible by Content Assist.    </p>\n    <p>Applies to: Function, Property    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@internal    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Specifies that a function or property should not be made visible by Content Assist.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows an @internal tag.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @internal</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*/</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1tZW1iZXJPZg\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1tZW1iZXJPZg\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AbWVtYmVyT2Y\">\n        <h3 class=\"heading \"><span>@memberOf</span></h3>\n    <p>Signifies that a function is a member of the specified class.    </p>\n    <p>Applies to: Function, Property.    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@memberOf <i class=\" \">Class</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @memberOf tag to signify that a function is a member of the specified class.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows that the getFoo function is a member of the fooBar class.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @memberOf fooBar</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*/</code></div>\n<div class=\"line\"><code class=\"plain\">function getFoo(){</code></div>\n<div class=\"line\"><code class=\"plain\">}</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1tZXRob2Q\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1tZXRob2Q\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AbWV0aG9k\">\n        <h3 class=\"heading \"><span>@method</span></h3>\n    <p>Signifies that a function is a method of a class, if applicable.    </p>\n    <p>Applies to: Function    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@method    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @method tag to signify a method of a class if you are coding in an object-oriented programming style.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a @method tag.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\">* @method</code></div>\n<div class=\"line\"><code class=\"preprocessor\">*/</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1uYW1lc3BhY2U\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1uYW1lc3BhY2U\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AbmFtZXNwYWNl\">\n        <h3 class=\"heading \"><span>@namespace</span></h3>\n    <p>Creates the namespace prefix for a library file.    </p>\n    <p>Applies to: File    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@namespace <i class=\" \">namespaceName</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Creates the link between the namespace of a library file and an external .sdoc file.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows how to use the @namespace tag to link the namespace of a library to an .sdoc file.    </p>\n    <p>The excerpt below would go at both the top of the library file that contains the &quot;ajax&quot; namespace for the &quot;snazzyLib&quot; library and the corresponding &quot;ajax.sdoc&quot; file that contains the documentation for the &quot;ajax&quot; namespace in snazzyLib:    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @namespace snazzyLib.ajax</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wYXJhbQ\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wYXJhbQ\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcGFyYW0\">\n        <h3 class=\"heading \"><span>@param</span></h3>\n    <p>Use @param to tag each parameter for a function.    </p>\n    <p>Applies to: Function    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@param { <i class=\" \">Type</i> [, <i class=\" \">Type</i>, ... ]}  [ <strong class=\" \">...</strong> ] <i class=\" \">ParameterName</i> <i class=\" \">Parameter-Description</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Gives information about a parameter for a function. Specify the data type between the curly braces. If the parameter is optional, add &apos;[ ]&apos; around the parameter name. An ellipsis (...) after the parameter type indicates that the parameter can be repeated.    </p>\n    <p><strong class=\" \">Examples</strong>    </p>\n    <p><i class=\" \">Standard example</i>    </p>\n    <p>The following example shows a parameter for a function that takes a String named myDog.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @param {String} myDog The name of the dog. </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p><i class=\" \">Optional parameter example</i>    </p>\n    <p>The following example shows an optional parameter that can be either a String or a Date.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @param {String, Date} [myDate] Specifies the date, if applicable.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p><i class=\" \">Multiple objects example</i>    </p>\n    <p>The following example shows a parameter that can be one or more Strings.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @param {String} ... Takes one or more dog parameters.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wcml2YXRl\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wcml2YXRl\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcHJpdmF0ZQ\">\n        <h3 class=\"heading \"><span>@private</span></h3>\n    <p>Signifies that a class or a function is private.    </p>\n    <p>Applies to: Function, Property    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@private    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @private tag to signify that a class or function is private. The ScriptDoc output will not include private classes or functions unless you run ScriptDoc with the <i class=\" \">--private</i> commmand line argument.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a private function that returns a foo.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * This function creates a new foo.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @private</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @return {Object} Returns a foo.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wcm9qZWN0RGVzY3JpcHRpb24\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wcm9qZWN0RGVzY3JpcHRpb24\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcHJvamVjdERlc2NyaXB0aW9u\">\n        <h3 class=\"heading \"><span>@projectDescription</span></h3>\n    <p>Gives a description of a JavaScript file.    </p>\n    <p>Applies to: File.    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@projectDescription <i class=\" \">Description</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @projectDescription tag as the first tag in the first documentation block for a JavaScript file. The @projectDescription tag signifies that the entire documentation block is part of a project description.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows the @projectDescription tag used with the <a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1hdXRob3I\">@author</a> and <a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi12ZXJzaW9u\">@version</a> tags to provide header information for a JavaScript file.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/** </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @projectDescription\tThis library contains a lot of classes and functions.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> *</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @author \tJoe Smith jsmith@company.com</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @version \t0.1 </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wcm9wZXJ0eQ\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wcm9wZXJ0eQ\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcHJvcGVydHk\">\n        <h3 class=\"heading \"><span>@property</span></h3>\n    <p>Indicates that a member is a property of a class instance    </p>\n    <p>Applies to: File.    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@property {<i class=\" \">Type</i> [, <i class=\" \">Type</i>, ... ]}    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @property tag to indicate that the following member is a property (as opposed to a method) of a class instance.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows the @property tag being used to define a &quot;myProperty&quot; property on the MyClass class. The property contains a description and will be treated as a String.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/** </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * This is a property of class MyClass</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> *</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @alias MyClass.myProperty</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @property {String}</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1yZXR1cm4\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1yZXR1cm4\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AcmV0dXJu\">\n        <h3 class=\"heading \"><span>@return</span></h3>\n    <p>Specifies information about the return value(s) of a function.    </p>\n    <p>Applies to: Function    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@return {<i class=\" \">Type</i> [, <i class=\" \">Type</i>, ...]} <i class=\" \">Returns-Description</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>@return gives a description for the return value of a function.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a return value for a function that returns a new foo object.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/** </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @return {Object} Returns a new foo object.\t</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1zZWU\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1zZWU\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1Ac2Vl\">\n        <h3 class=\"heading \"><span>@see</span></h3>\n    <p>Links to another related class or function.    </p>\n    <p>Applies to: Any    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@see <i class=\" \">Class | #Function | Class#Function</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Use the @see tag to add a link to another class, a function within the current class, or a function in another class.    </p>\n    <p><strong class=\" \">Examples</strong>    </p>\n    <p><i class=\" \">Function example</i>    </p>\n    <p>This example shows a link to a function named &quot;foo&quot; in the same class as the one being documented.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @see #foo</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p><i class=\" \">Class example</i>    </p>\n    <p>This example shows a link to a class named &quot;fooBar&quot;.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @see fooBar</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p><i class=\" \">Function in another class example</i>    </p>\n    <p>This example shows a link to a function named &quot;foo&quot; in another class named &quot;fooBar&quot;.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @see fooBar#foo</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1zaW5jZQ\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1zaW5jZQ\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1Ac2luY2U\">\n        <h3 class=\"heading \"><span>@since</span></h3>\n    <p>Specifies since which version the library, function, or property became valid.    </p>\n    <p>Applies to: File, Function, Property    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@since <i class=\" \">Version-number</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Specifies since which version the library, function, or property became valid.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows a @since tag, used in conjunction with @projectDescription, @author, and @version tags. A documentation block like this would go at the top of a JavaScript file.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/** </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @projectDescription\tThis library contains a lot of classes and functions.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> *</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @author \tJoe Smith jsmith@company.com</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @version \t1.1 </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @since\t1.0</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi10eXBl\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi10eXBl\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AdHlwZQ\">\n        <h3 class=\"heading \"><span>@type</span></h3>\n    <p>Specifies what data type a property is.    </p>\n    <p>Applies to Property    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@type {<i class=\" \">Type</i>}    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Specifies what data type a property is.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example uses the  @type tag to show the type for a property.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/**</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * This property describes what type of shape an object is.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @type {Object} This property describes what type of shape an object is.</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    <p>    <span id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi12ZXJzaW9u\"><a class=\"confluence-anchor-link\" name=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi12ZXJzaW9u\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1AdmVyc2lvbg\">\n        <h3 class=\"heading \"><span>@version</span></h3>\n    <p>Specifies the version number of the JavaScript file or class.    </p>\n    <p>Applies to: Any    </p>\n    <p><strong class=\" \">Syntax</strong>    </p>\n    <p>@version <i class=\" \">Version-Number</i>    </p>\n    <p><strong class=\" \">Description</strong>    </p>\n    <p>Specifies the version number of the JavaScript file or class.    </p>\n    <p><strong class=\" \">Example</strong>    </p>\n    <p>This example shows the @version tag used with the <a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1wcm9qZWN0RGVzY3JpcHRpb24\">@projectDescription</a> and <a class=\"document-link \" href=\"#!/guide/ScriptDoc_(SDOC)_2.0_Specification-section-src-30083174_safe-id-U2NyaXB0RG9jKFNET0MpMi4wU3BlY2lmaWNhdGlvbi1hdXRob3I\">@author</a> tags to provide header information for a JavaScript file.    </p>\n    <div class=\"confbox programlisting defaultnew syntaxhighlighter scroll-html-formatted-code\">\n                <div xmlns=\"http://www.w3.org/1999/xhtml\" class=\"defaultnew syntaxhighlighter scroll-html-formatted-code\">\n<div class=\"line\"><code class=\"preprocessor\">/** </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @projectDescription A description of the file ahead</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> *</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @author \tJoe Smith jsmith@company.com</code></div>\n<div class=\"line\"><code class=\"preprocessor\"> * @version \t0.1 </code></div>\n<div class=\"line\"><code class=\"preprocessor\"> */</code></div>\n</div>\n    </div>\n    </div>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=30083174\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"ScriptDoc (SDOC) 2.0 Specification"});